import React from 'react'
import { Routes,Route } from 'react-router-dom'
import Home from './Home';
import About from './About';


const App = () => {
  return (
    <>
      <Routes>
        <Route exact path='/' Component={Home}></Route>
        <Route></Route>
        <Route></Route>
        <Route></Route>
      </Routes>
    </>
  );
}

export default App
